import React, { useState } from "react";

function Faq() {
  const [activeIndex, setActiveIndex] = useState(null);

  const handleAccordionClick = (index) => {
    setActiveIndex(index === activeIndex ? null : index);
  };

  const accordionData = [
    {
      id: 1,
      question: "How do I enroll?",
      answer: "Please contact our team member to fill out the membership form",
    },
    {
      id: 2,
      question: "How can I register for the class sessions?",
      answer: "Please visit the enrollment section or visit this link",
    },
    {
      id: 3,
      question: "Is there any private coaching classes?",
      answer: "Yes, we do have private dance classes.",
    },
  ];

  return (
    <div className="row my-5 g-5 justify-content-around align item center">
      <div className="accordion" id="accordionPanelsStayOpenExample">
        {accordionData.map((item) => (
          <div className="accordion-item" key={item.id}>
            <h2 className="accordion-header" id={`panelsStayOpen-heading${item.id}`}>
              <button
                className={`accordion-button ${activeIndex === item.id ? "" : "collapsed"}`}
                type="button"
                onClick={() => handleAccordionClick(item.id)}
              >
                {item.question}
              </button>
            </h2>
            <div
              id={`panelsStayOpen-collapse${item.id}`}
              className={`accordion-collapse collapse ${activeIndex === item.id ? "show" : ""}`}
              aria-labelledby={`panelsStayOpen-heading${item.id}`}
            >
              <div className="accordion-body">
                <strong><p>{item.answer}</p></strong>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Faq;
